      <Navbar.Brand >
        <img id="mainLogo" src={logo} width="60px"></img>
      </Navbar.Brand>

      <Navbar.Toggle />
      <Navbar.Collapse>
        <Nav id="barItems">
          <Nav.Link className='mr-5' href="#">Home</Nav.Link>
          <Nav.Link href="#">Contact</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default navbar;
